import img0 from "../img/logo192.png";

export const selectionList = [
    {
        id: 1,
        name: "이게 맵다고?",
        img: {img0},
    },
    {
        id: 2,
        name: "딱 맛있게 맵다",
        img: {img0},
    },
    {
        id: 3,
        name: "좀 맵지만 즐길 수는 있다",
        img: {img0},
    },
    {
        id: 4,
        name: "휴 도전이었다",
        img: {img0},
    },
    {
        id: 5,
        name: "다시는 못 먹을 매운맛!! ㅠ",
        img: {img0},
    },
]
